import 'package:intl/intl.dart';

class Task {
  int _id;
  String _imgB64;
  String _titulo;
  String _descripcion;
  DateTime _fecha;
  int _dia;
  int _mes;
  int _anio;
  bool _completada = false;

  Task(this._id, this._imgB64, this._titulo, this._descripcion, this._fecha, this._dia, this._mes, this._anio,
      this._completada);

  Task.min({required String titulo, required String descripcion, required DateTime fecha})
      : _titulo = titulo,
        _descripcion = descripcion,
        _fecha = fecha,
        _id = 0,
        _imgB64 = '',
        _dia = fecha.day,
        _mes = fecha.month,
        _anio = fecha.year;

  Task.foo()
      : this.min(
            titulo: 'Enviar documentación',
            descripcion:
                'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.',
            fecha: DateTime.now());

  bool get completada => _completada;

  set completada(bool value) {
    _completada = value;
  }

  int get anio => _anio;

  set anio(int value) {
    _anio = value;
  }

  int get mes => _mes;

  set mes(int value) {
    _mes = value;
  }

  int get dia => _dia;

  set dia(int value) {
    _dia = value;
  }

  DateTime get fecha => _fecha;

  set fecha(DateTime value) {
    _fecha = value;
  }

  String get descripcion => _descripcion;

  set descripcion(String value) {
    _descripcion = value;
  }

  String get titulo => _titulo;

  set titulo(String value) {
    _titulo = value;
  }

  String get imgB64 => _imgB64;

  set imgB64(String value) {
    _imgB64 = value;
  }

  String get formatDate => DateFormat('dd/MM/yy').format(_fecha);
}
